      headers: {
        'X-RapidAPI-Key': '7cb9de774emshd8f470f6751218dp160e76jsn61da3ebeea56',
        'X-RapidAPI-Host': 'amazon-price1.p.rapidapi.com',
      },
    }

    fetch(
      'https://amazon-price1.p.rapidapi.com/priceReport?asin=%3CREQUIRED%3E&marketplace=ES',
      options,
    )
      .then((response) => response.json())
      .then((response) => console.log(response))
